(3, 13, 'Tapan Choudhury', 'tapsash@gmail.com', 'Haryana', 'tapan-choudhury-from-haryana', '29 years', '4.6', '100', '91 9873628941', 'English, Hindi', '25220968_2022-02-14.jpg', 'Active', 'Central Administrative Tribunal (CAT) Delhi, Delhi High Court, District Court, Dwarka, District Court, Faridabad, District Court, Gautambuddha Nagar, District Court, Ghaziabad, District Court, Gurgaon, District Court, Karkardooma , District Court, Patiala House, District Court, Rohini, District Court, Saket, District Court, Tis Hazari, Supreme Court Of India', '<p>Advocate Sudershani has since been practicing and handling cases independently with a result oriented approach, both professionally and ethically and has now acquired 8 years of professional experience in providing legal consultancy and advisory services. She has completed her BA.LLB(Hons) from Jamia Millia Islamia and has been practicing and handling cases independently and provides legal consultancy and advisory services.<br />\r\n<br />\r\nAdvocate Sudershani provides services in various field of civil as well as corporate laws, inter-alia, Suits, Writs, Petitions, Appeals, Revisions, Complaints relating to debt recovery, dishonor of cheques, rent control act, property disputes, matrimonial disputes, consumer complaints, complaints pertaining to Food Adulteration Act and service matter . In addition to this she is skilled in drafting and vetting various kinds of agreement such as Master Service Agreement, Service Agreement, Teaming Agreement, Consortium Agreement, various Tripartite Agreement, RFQs, Letter of Intent, MOU, Agreement with Celebrity, Endorsement Agreement, License Agreement, Sub-Licensing Agreement, Sub-Contracting, Third Party Agreement, Sale Deed, Corporate Lease Agreement, Development Agreement(Real estate), broadcasting agreement.<br />\r\n<br />\r\nAdvocate Ray enrolled with the Bar Council of Delhi in 2008. She is also a member of the Delhi Bar Council.<br />\r\n<br />\r\nEnrollment Number : D/1455/08</p>', 'Arbitration, Cheque Bounce, Child Custody, Court Marriage, Criminal, Divorce, Documentation, Domestic Violence, Family, High Court, Muslim Law, Property, Recovery', '2023-10-24 10:31:11', '2023-10-24 10:57:01', 1);
