(196, '27', '15', '3', 'Infinity - JBL Tranz 710, 72 Hrs Playtime with Quick Charge, Wireless On Ear Headphone with Mic, Deep Bass, Dual Equalizer, Bluetooth 5.0 with Voice Assistant Support (Black)', '‎72 Hours Playtime , Dual Equalizer ,Deep Bass,Quick Charging ,Hands-free calling', '1', NULL, NULL, NULL, '', '', 'infinity---jbl-tranz-710--72-hrs-playtime-with-quick-charge--wireless-on-ear-headphone-with-mic--deep-bass--dual-equalizer--bluetooth-5.0-with-voice-assistant-support--black-', NULL, NULL, '1283764335_716il5u5f4l.-sy450-.jpg', '<p>Long Get set for an immersive sound experience for three days straight. New Tranz 710 has an astonishing 72 hours playtime, and a 36mm Driver to boot, so pumping out nonstop superior beats will become your daily norm. No charging, no fuss. These Bluetooth, wireless, soft cushioned headphones can be worn comfortably around your neck for hours on end, and the super lightweight, foldable design means they can easily go wherever you go. With battery life sorted for 3 whole days, let your music play on and on without the worry or fuss of charging again. Let google assistant guide you with whatever you need along the way. While deep bass and dual equaliser will ensure only superior sound is delivered to your senses. Charging is so yesterday; this wireless beauty has got you covered.</p>\r\n', '2023-10-07 13:56:43', '2023-10-10 13:19:41', 1),
(197, '27', '15', '4', 'Toreto TOR-1203 Melody-5 in-Ear Wired Earphones with Mic Wired Headset  (Black, In the Ear)', ' This uniquely designed Product is made of very fine quality material and comes in various ranges & varieties and hence fulfills the need of all.', '1', NULL, NULL, NULL, '', '', 'toreto-tor-1203-melody-5-in-ear-wired-earphones-with-mic-wired-headset---black--in-the-ear-', NULL, NULL, '1319787420_312dwywgzul.-sy450-.jpg', '<p>General</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Model Name</td>\r\n			<td>\r\n			<ul>\r\n				<li>TOR-1203 Melody-5 in-Ear Wired Earphones with Mic</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Color</td>\r\n			<td>\r\n			<ul>\r\n				<li>Black</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Headphone Type</td>\r\n			<td>\r\n			<ul>\r\n				<li>In the Ear</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Inline Remote</td>\r\n			<td>\r\n			<ul>\r\n				<li>Yes</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Sales Package</td>\r\n			<td>\r\n			<ul>\r\n				<li>1 Earphone, 1 Warranty Card</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Connectivity</td>\r\n			<td>\r\n			<ul>\r\n				<li>Wired</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Headphone Design</td>\r\n			<td>\r\n			<ul>\r\n				<li>Canalphone</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Compatible Devices</td>\r\n			<td>\r\n			<ul>\r\n				<li>Audio Player, Mobile, Studio Recording, Tablet</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Product Details</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Deep Bass</td>\r\n			<td>\r\n			<ul>\r\n				<li>Yes</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Designed For</td>\r\n			<td>\r\n			<ul>\r\n				<li>All Smartphones, Tablet, Laptop, Audio Player</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Connector Size</td>\r\n			<td>\r\n			<ul>\r\n				<li>3.5 mm</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Other Features</td>\r\n			<td>\r\n			<ul>\r\n				<li>Toreto TOR-1203 earphones with microphone come with HD stereo sound, Excellent Sound Quality, With In-Line Mic, permits you to answer calls and music Play/Pause on the press of a button., This mobile phone headsets are Super light soft design. Absolute soft unquestionably agreeable for 24 hours wear., Lightweight metal earphones come with 10mm dynamic drivers Impedance 16?, Frequency Response 20H-20KHz., 1 Meter long durable tangle-free cable and universal compatible with devices with 3.5mm jack.</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>With Microphone</td>\r\n			<td>\r\n			<ul>\r\n				<li>Yes</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Sound Features</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Sensitivity</td>\r\n			<td>\r\n			<ul>\r\n				<li>92 dBmW</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Impedance</td>\r\n			<td>\r\n			<ul>\r\n				<li>16 ohm</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Dimensions</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Width</td>\r\n			<td>\r\n			<ul>\r\n				<li>3 mm</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Height</td>\r\n			<td>\r\n			<ul>\r\n				<li>14 mm</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Weight</td>\r\n			<td>\r\n			<ul>\r\n				<li>35</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Cord Length</td>\r\n			<td>\r\n			<ul>\r\n				<li>1 m</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p>Warranty</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td>Domestic Warranty</td>\r\n			<td>\r\n			<ul>\r\n				<li>1 Year</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Warranty Summary</td>\r\n			<td>\r\n			<ul>\r\n				<li>1 Year Limited Domestic Brand Warranty</li>\r\n			</ul>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Warranty Service Type</td>\r\n			<td>\r\n			<ul>\